import React, { useState } from 'react';

import TextField from '@material-ui/core/TextField';

const AddNote = ({ saveTodo }) => {
  return (
      <form
          onSubmit={event => {
              event.preventDefault();
              saveTodo(value);
          }}
      >
        <TextField
            variant="outlined"
            placeholder="Add note"
            margin="normal"
        />
      </form>
  );
};

export default AddNote;
